import {MDBContainer} from "mdbreact";
import React, {Fragment} from "react";
import {Bar} from "react-chartjs-2";



export type ChartProps = {
    BarChartData?:any;
    barChartOptions?:any;
    donutchartdata?: any;
    data?:any;
    graphData?:any;

}

const Charts=(props:ChartProps)=> {


if(props?.data?.id === "1"){
  return (
<Fragment>

  <MDBContainer>
     <Bar data={props?.data} options={props?.barChartOptions} height={props?.BarChartData?.height} />
   </MDBContainer>
</Fragment>

)

}
else if(1){
return (
 <div>
   hi
 </div>

)
}

}

export default Charts;
